              class="bg-[#D9D9D9] py-2 px-6 rounded-lg text-black border-none"
            />
          </div>

          <div class="flex flex-col gap-2">
            <label for="Phonenumber">Nomor. HP</label>
            <input
              v-model="phonenumber"
              type="text"
              name="Phonenumber"
              class="bg-[#D9D9D9] py-2 px-6 rounded-lg text-black border-none"
            />
          </div>

          <div class="flex flex-col gap-2">
            <label for="Username">Username</label>
            <input
              v-model="username"
              type="text"
              name="Username"
              class="bg-[#D9D9D9] py-2 px-6 rounded-lg text-black border-none"
            />
          </div>
          <div class="flex flex-col gap-2">
            <label for="Gender">Gender</label>
            <input
              v-model="Gender"
              type="text"
              name="Gender"
              class="bg-[#D9D9D9] py-2 px-6 rounded-lg text-black border-none"
            />
          </div>
          <div class="flex flex-col gap-2">
            <label for="rekening">Nomor Rekening</label>
            <input
              v-model="rekening"
              type="text"
              name="rekening"
              class="bg-[#D9D9D9] py-2 px-6 rounded-lg text-black border-none"
            />
          </div>
          <div class="flex flex-col gap-2">
            <label for="Dateofbirth">Date Of Birth</label>
            <input
              v-model="dateofbirth"
              type="text"
              placeholder="YYYY-MM-DD"
              name="Dateofbirth"
              class="bg-[#D9D9D9] py-2 px-6 rounded-lg text-black border-none"
            />
          </div>
          <div class="flex flex-col gap-2">
            <label for="Password">Password</label>
            <input
              v-model="password"
              type="password"
              name="Password"
              class="bg-[#D9D9D9] py-2 px-6 rounded-lg text-black border-none"
