        <div
          @click="submit"
          class="cursor-pointer w-full bg-[#EE6F57] text-white rounded-lg flex items-center justify-center py-2"
        >
          Register
        </div>

        <p
          class="flex items-center justify-center w-full font-medium text-black"
        >
          Sudah miliki akun sebelumnya?
          <span
            class="pl-2 font-semibold cursor-pointer text-[#EE6F57]"
            @click="login"
            >Login</span
          >
