  </div>
</template>

<script>
import axios from 'axios'
export default {
  data() {
    return {
      email: '',
      username: '',
      password: '',
      phonenumber: '',
      dateofbirth: '',
      Gender: '',
      rekening: '',
    }
  },
  layout: 'empty',
  methods: {
    login() {
      this.$router.push('/Login')
    },
    submit() {
      axios
        .post(
          'https://ec2-54-160-45-255.compute-1.amazonaws.com:8080/v1/users',
          {
            name: this.username,
            email: this.email,
            phone_number: this.phonenumber,
            password: this.password,
            date_of_birth: this.dateofbirth,
            gender: this.Gender,
            account_number: this.rekening,
          }
        )
        .then((response) => {
          if (response.data.message === 'success create new user') {
            this.$router.push('/Login')
          }
        })
    },
  },
}
</script>

